"    <div id=\"topicTitle\">",
"     Patient information: Screening for hearing loss in newborns (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H97592947\">",
"      <span class=\"h1\">",
"       Why does my newborn need to be screened for hearing loss?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Newborns should be screened for hearing loss because the sooner you know that your baby has a hearing problem, the sooner he or she can be treated. Early treatment can make your child less likely to have problems learning to talk.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H97592964\">",
"      <span class=\"h1\">",
"       How will my newborn be screened for hearing loss?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are 2 different tests for hearing loss in newborns:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Auditory brainstem response &ndash; For this test, the doctor will put 3 small devices called electrodes on your baby: on the forehead, back of the neck, and behind the ear. The electrodes connect to a machine that measures how your baby&rsquo;s brain responds to a clicking sound.",
"       </li>",
"       <li>",
"        Otoacoustic emissions &ndash; For this test, the doctor puts a small microphone into your baby&rsquo;s ear. The microphone makes sounds (clicks or a tone). It also measures sound from the cochlea, the area inside the ear that allows you to hear (",
"        <a class=\"graphic graphic_figure graphicRef55121 \" href=\"mobipreview.htm?29/61/30677\">",
"         figure 1",
"        </a>",
"        ).",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Both of these tests are painless and take between 5 to 15 minutes. If a test suggests that your newborn has hearing loss, he or she will get another test. Your baby might also need to be checked by an expert in hearing problems, called an &ldquo;audiologist.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H97592979\">",
"      <span class=\"h1\">",
"       Are some newborns more likely to have hearing loss?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Newborns with certain conditions are more likely to have hearing loss. These conditions include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Being in the &ldquo;neonatal intensive care unit&rdquo; (also called the &ldquo;NICU&rdquo;) for more than 2 days. Newborns spend time in the NICU if they are born too early or have other health problems.",
"       </li>",
"       <li>",
"        A family history of hearing loss in childhood or other conditions that cause hearing problems",
"       </li>",
"       <li>",
"        An abnormal shape to 1 or both ears",
"       </li>",
"       <li>",
"        Infections",
"       </li>",
"       <li>",
"        A serious form of a condition called &ldquo;jaundice&rdquo; that causes yellow skin and other problems",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H97592996\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
