"     Reproduced with permission from: Magnani JW, Rienstra M, Lin H, et al. Atrial fibrillation: Current knowledge and future directions in epidemiology and genomics. Circulation 2011; 124:1982. Copyright &copy; Lippincott Williams &amp; Wilkins.",
"    </div>",
