var title_f33_19_34107="Histologic features of OP";
var content_f33_19_34107=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F60654&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F60654&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Histologic features of organizing pneumonia pattern",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Key histologic features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Organizing pneumonia: intraluminal organizing fibrosis in distal airspaces (bronchioles, alveolar ducts, and alveoli)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Patchy and peribronchiolar distribution",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Preservation of lung architecture",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Uniform and recent temporal appearance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mild interstitial chronic inflammation (eg, lymphocytes and edema)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Foamy macrophages are common in alveolar spaces, likely due to bronchiolar obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Pertinent negative findings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Absence of severe fibrotic changes (eg, honeycombing); incidental scars or apical fibrosis may be present",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Granulomas are absent; giant cells are rare or absent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lack of prominent infiltration of eosinophils or neutrophils",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Absence of necrosis or abscess",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Absence of vasculitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lack of hyaline membranes or prominent airspace fibrin*",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Intra-alveolar fibrin deposition is seen in acute fibrinous and organizing pneumonia; it is unclear whether this is a separate entity or a variant of organizing pneumonia.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
